import { fetcher } from "@repo/utils/fetcher";
import type { TeamDashboardMetrics, DashboardTimeRange } from "@/domain/dashboard/types/dashboard";

// ==================== TYPES ====================

interface UseDashboardPrefetchOptions {
  enabled?: boolean;
  prefetchRanges?: DashboardTimeRange[];
}

// ==================== PUBLIC API ====================

/**
 * Hook for prefetching common dashboard time ranges to improve UX
 * @public
 */
export function useDashboardPrefetch({
  enabled = true,
  prefetchRanges = ["current_cycle", "last_cycle", "last_30_days"],
}: UseDashboardPrefetchOptions = {}) {
  const queryClient = useQueryClient();

  useEffect(() => {
    if (!enabled) return;

    const prefetchTimeRange = async (timeRange: DashboardTimeRange) => {
      const queryKey = [
        "dashboard",
        "teams",
        { timeRange, teamIds: undefined, compareWithPrevious: true },
      ];

      // Only prefetch if not already cached
      const existing = queryClient.getQueryData(queryKey);
      if (existing) return;

      const queryParams = new URLSearchParams({
        timeRange,
        compareWithPrevious: "true",
      });

      try {
        await queryClient.prefetchQuery({
          queryKey,
          queryFn: async () => {
            const result = await fetcher<TeamDashboardMetrics[]>(
              `/api/dashboard/teams?${queryParams}`
            );

            if (!result.ok) {
              throw new Error(result.error);
            }

            return result.data;
          },
          staleTime: 30 * 1000, // 30 seconds
        });
      } catch (error) {
        // Silently fail prefetch to avoid disrupting user experience
        console.debug("Failed to prefetch dashboard data", { timeRange, error });
      }
    };

    // Prefetch common ranges with a small delay to avoid blocking initial render
    const timeoutId = setTimeout(() => {
      prefetchRanges.forEach((timeRange) => {
        prefetchTimeRange(timeRange);
      });
    }, 1000);

    return () => clearTimeout(timeoutId);
  }, [enabled, prefetchRanges, queryClient]);
