import { useRouter, useSearchParams } from "next/navigation";
import type { DashboardTimeRange } from "@/domain/dashboard/types/dashboard";
import { TIME_RANGE_OPTIONS } from "./useTimeRange";

// ==================== TYPES ====================

interface DashboardFilters {
  timeRange: DashboardTimeRange;
  compareWithPrevious: boolean;
  selectedLeadId: string | null;
}

// ==================== PRIVATE HELPERS ====================

/**
 * Validates if a string is a valid DashboardTimeRange
 * @private
 */
function isValidTimeRange(value: string): value is DashboardTimeRange {
  return TIME_RANGE_OPTIONS.some((option) => option.value === value);
}

/**
 * Updates URL search parameters without triggering navigation
 * @private
 */
function updateSearchParams(
  params: URLSearchParams,
  updates: Record<string, string | boolean | null>
): string {
  const newParams = new URLSearchParams(params);

  Object.entries(updates).forEach(([key, value]) => {
    if (value === null || value === "" || value === false) {
      newParams.delete(key);
    } else if (typeof value === "boolean") {
      newParams.set(key, "true");
    } else {
      newParams.set(key, value);
    }
  });

  return newParams.toString();
}

// ==================== PUBLIC API ====================

/**
 * Hook for managing dashboard filters with URL persistence
 * @public
 */
export function useDashboardFilters(initialTimeRange: DashboardTimeRange = "current_cycle") {
  const router = useRouter();
  const searchParams = useSearchParams();

  // Initialize state from URL params or defaults
  const getInitialFilters = (): DashboardFilters => {
    const urlTimeRange = searchParams.get("timeRange");
    const urlComparison = searchParams.get("compare");
    const urlLeadId = searchParams.get("lead");

    return {
      timeRange: urlTimeRange && isValidTimeRange(urlTimeRange) ? urlTimeRange : initialTimeRange,
      compareWithPrevious: urlComparison !== "false", // Default to true unless explicitly false
      selectedLeadId: urlLeadId || null,
    };
  };

  const [filters, setFilters] = useState<DashboardFilters>(getInitialFilters);

  // Sync state with URL params on mount and when search params change
  useEffect(() => {
    const urlTimeRange = searchParams.get("timeRange");
    const urlComparison = searchParams.get("compare");
    const urlLeadId = searchParams.get("lead");

    const newFilters: DashboardFilters = {
      timeRange: urlTimeRange && isValidTimeRange(urlTimeRange) ? urlTimeRange : initialTimeRange,
      compareWithPrevious: urlComparison !== "false",
      selectedLeadId: urlLeadId || null,
    };

    // Only update state if something actually changed
    if (
      newFilters.timeRange !== filters.timeRange ||
      newFilters.compareWithPrevious !== filters.compareWithPrevious ||
      newFilters.selectedLeadId !== filters.selectedLeadId
    ) {
      setFilters(newFilters);
    }
  }, [searchParams, filters, initialTimeRange]);

  const updateFilters = useCallback(
    (updates: Partial<DashboardFilters>) => {
      const newFilters = { ...filters, ...updates };
      setFilters(newFilters);

      // Update URL
      const newSearchParams = updateSearchParams(searchParams, {
        timeRange: newFilters.timeRange,
        compare: newFilters.compareWithPrevious,
        lead: newFilters.selectedLeadId,
      });

      router.replace(`?${newSearchParams}`, { scroll: false });
    },
    [router, searchParams, filters]
  );

  const updateTimeRange = useCallback(
    (timeRange: DashboardTimeRange) => {
      updateFilters({ timeRange });
    },
    [updateFilters]
  );

  const toggleComparison = useCallback(() => {
    updateFilters({ compareWithPrevious: !filters.compareWithPrevious });
  }, [updateFilters, filters.compareWithPrevious]);

  const updateLeadSelection = useCallback(
    (selectedLeadId: string | null) => {
      updateFilters({ selectedLeadId });
    },
    [updateFilters]
  );

  const currentTimeRangeOption = TIME_RANGE_OPTIONS.find(
    (option) => option.value === filters.timeRange
  );

  const isCycleBased = filters.timeRange.includes("cycle");

  return {
    // Current filter values
    timeRange: filters.timeRange,
    compareWithPrevious: filters.compareWithPrevious,
    selectedLeadId: filters.selectedLeadId,

    // Computed values
    currentTimeRangeOption,
    isCycleBased,

    // Update functions
    updateTimeRange,
    toggleComparison,
    updateLeadSelection,
    updateFilters,
  };
}","metadata":{"exit_code":0,"duration_seconds":0.0}}

